-- 
-- IANA protocols
-- <http://www.iana.org/assignments/protocol-numbers>, last updated 2008-04-1	
--
CREATE TABLE net.e_iana_protocols (
	e_protocol_id	int,					-- assigned by IANA
	keyword			text,					-- protocol short name, can be NULL ... sigh!
	description		text,					-- full description
	reference		text,					-- can be an RFC or something else
	assigned		boolean NOT NULL,		-- is the protocol number assigned ?
	reserved		boolean NOT NULL,		-- is the protocol number reserved ?
	PRIMARY KEY (e_protocol_id)
	);
	
-- 100
-- unassigned 


--
-- IANA port ranges
-- <http://www.iana.org/assignments/port-numbers>, last updated 2008-08-01
--
CREATE SEQUENCE net.e_iana_port_range_serial;
CREATE TABLE net.e_iana_port_range (
        e_iana_port_range_id    int     DEFAULT nextval('net.e_iana_port_range_serial'),
        range_begin             int     NOT NULL,
        range_end               int     NOT NULL,
        range_name              text    UNIQUE NOT NULL,
        PRIMARY KEY(e_iana_port_range_id)
);


--
-- IANA ports
-- <http://www.iana.org/assignments/port-numbers>, last updated 2008-08-01
--
CREATE SEQUENCE net.e_net_iana_registered_ports_serial;
CREATE TABLE net.e_iana_registered_ports (
	t_net_iana_port_id	int	DEFAULT nextval('net.e_net_iana_registered_ports_serial'),
	port			int	 NOT NULL,
	description		text DEFAULT NULL,
	keyword			text DEFAULT NULL, -- a same port can have multiple keywords, one per protocol
	e_protocol_id 	int,	-- IANA protocol ID (must be either NULL or 6, 17, 33 or 132 for tcp, udp, dccp, sctp)
	assigned		boolean DEFAULT false,  -- IANA assigned
	reserved		boolean DEFAULT false,   -- IANA reserved, may be assigned later
	PRIMARY KEY(t_net_iana_port_id)
	);
	
